INSERT INTO `news` VALUES (21,'Интернет портал общедоступной информации о расходах муниципальных образований «Расходы города».','Проект реализуется Автономной некоммерческой организации\n«Центр мониторинга и организации взаимодействия населения и органов государственной власти в сфере предоставления общедоступной информации о финансовых ресурсах муниципальных образований».','2017-05-27',1,20,'2015-02-19 10:45:02',NULL),(22,'Доступ к сайту','Профилактические работы версии сайта 0.3 с 23.00 до 07.00, время московское. Работа сайта с 07.00 до 23.00, время московское.','2017-07-10',1,20,'2017-07-10 11:04:36','2018-04-12 18:41:29'),(23,'Комментарии от граждан','Комментарии от граждан приходят на внутреннюю почту сайта и дают понять представителям муниципальной власти города насколько качественно предоставляется услуга.','2017-08-26',1,20,'2017-08-26 13:23:13',NULL),(26,'Работа с данными','Ввод  данных о расходах возможен из разных ведомств муниципалитета  по направлению. Возможен ввод данных в ручную или с помощью конечных баз  (по запросу). Информация из диаграммы расходов - справочная и зависит только от внесённой информации, позволяющая оценить приоритеты в расходовании денежных средств.','2017-08-26',1,20,'2017-08-26 13:48:00',NULL),(28,'Главная идея проекта','Заключается в том, чтобы представители муниципалитетов  максимально доступно и просто донесли чуть более детализированную информацию до населения, какие виды работ и услуг планируются или сделаны в их городе. Например:  даже указав детализировано 20 пунктов расхода денежных средств на ремонт  дорог, когда и на какой улице будет происходить ремонт, население уже будет  более информировано,  нежели  если оно увидит на официальном сайте города информацию  в виде конечной  суммы израсходованных денежных средств.','2017-08-27',1,20,'2017-08-27 12:55:32',NULL),(29,'Эл. почта и контакты','Вопросы и предложения по работе портала, а также пробный пароль/логин для различных ведомств муниципалитетов, чтобы оценить удобство администрирования по запросу на эл. почту info@rashodygoroda.ru','2017-08-30',1,20,'2017-08-30 16:51:47',NULL);
/*!40000 ALTER TABLE `news` ENABLE KEYS */;
UNLOCK TABLES;

